import Vue from 'vue';
import {mapGetters, mapMutations} from 'vuex';

export default Vue.extend({
    name: 'AddCandidateModal',
    data() {
        return {
            step: 1,
            position: null,
            position_list: [

            ]
        };
    },
    computed: {
        ...mapGetters([
            'modals/addCandidate',
        ]),
        showModal: {
            get(): any {
                return this['modals/addCandidate'];
            },
            set(val: boolean) {
                if (val === false) this.step = 1;
                this['modals/showAddCandidate'](val);
            }
        },
        hasInfo(): boolean {
            return true;
        }
    },
    methods: {
        ...mapMutations([
            'modals/showAddCandidate',
        ]),
    }
});
